const t=JSON.parse('{"key":"v-69c8c9a8","path":"/train/eda/algorithm-data/Part_7_algorithm/7_2_dynamic-programing/%E7%8A%B6%E6%80%81%E5%8E%8B%E7%BC%A9DP.html","title":"7.2.5 状态压缩DP","lang":"zh-CN","frontmatter":{"title":"7.2.5 状态压缩DP","order":5},"headers":[{"level":3,"title":"预备知识","slug":"预备知识","link":"#预备知识","children":[]},{"level":3,"title":"概述","slug":"概述","link":"#概述","children":[]}],"git":{"createdTime":1721213548000,"updatedTime":1721225740000,"contributors":[{"name":"Xingquan-Li","email":"fzulxq@gmail.com","commits":1},{"name":"simintao","email":"simintao@126.com","commits":1}]},"readingTime":{"minutes":7.56,"words":2269},"filePathRelative":"train/eda/algorithm-data/Part_7_algorithm/7_2_dynamic-programing/状态压缩DP.md","localizedDate":"2024年7月17日","excerpt":"<h3> 预备知识</h3>\\n<h4> 位运算</h4>\\n<p>常用的运算符共 6 种，分别为与（ &amp; ）、或（ | ）、异或（ ^ ）、取反（ ~ ）、左移（ &lt;&lt; ）和右移（ &gt;&gt; ）</p>\\n<ol>\\n<li>’&amp;’符号，x&amp;y，会将两个十进制数在二进制下进行与运算(都1为1，其余为0） 然后返回其十进制下的值。例如3(11)&amp;2(10)=2(10)。</li>\\n<li>’|’符号，x|y，会将两个十进制数在二进制下进行或运算（都0为0，其余为1） 然后返回其十进制下的值。例如3(11)|2(10)=3(11)。</li>\\n<li>’ ^ ’符号，x^y，会将两个十进制数在二进制下进行异或运算（不同为1，其余 为0）然后返回其十进制下的值。例如3(11)^2(10)=1(01)。</li>\\n<li>’ ~ ’符号， ~ x，按位取反。例如~101=010。</li>\\n<li>’&lt;&lt;’符号，左移操作，x&lt;&lt;2，将x在二进制下的每一位向左移动两位，最右边用0填充，x&lt;&lt;2相当于让x乘以4。</li>\\n<li>’&gt;&gt;’符号，是右移操作，x&gt;&gt;1，将x在二进制下的每一位向右移动两位，最左边用0填充，相当于给x/2，去掉x二进制下的最右一位。</li>\\n</ol>","copyright":{"author":"iEDA","license":"GPL-3.0"}}');export{t as data};
